import numpy as np

import matplotlib.pyplot as plt

import matplotlib.cm as cm

plt.style.use("dark_background")



M = np.random.standard_normal((1000, 2))

R = np.sum(M ** 2, axis = 1)

plt.scatter(M[:, 0], M[:, 1], c = R, cmap = 

   cm.Dark2, marker = 's', s = 35* R, edgecolors="black")

plt.xticks([])

plt.yticks([])

plt.grid(False)

plt.box(False)

plt.suptitle('Figure: Scatter plot & control marker sizes in matplotlib!', fontsize=12, color="yellow")

plt.show()

plt.figtext(0.86, 0.01, "© Mǟɖ↻ôɖɆⱤ™", color="white", fontsize=8)

plt.savefig('plot.png', dpi=200)

